import Navbar from '../components/Navbar'
import About from './About';

export default function index() {
    return (
        <div>
            <style jsx>{`
                div {
                    margin: auto;
                    width: 50%;
                    border: 3px solid green;
                    padding: 10px;
                    text-align: center;
                }

                .light {
                background-color: #999;
                }
            `}</style>
            <Navbar />
            <hr width="50%" />
            <About />
        </div>
    )
}
